namespace Dahua\QiniuSdk\Ocr;

use Dahua\QiniuSdk\Core\DHcurl;

class Main
{
    private $curl;
    private $token;

    public function __construct($token)
    {
        $this->curl = new DHcurl();
        $this->token = $token;
    }

    public function ocrBs($imageBase64)
    {
        $imageBase64 = 'data:image/jpeg;base64,';
        $response = $this->curl->setData([
            '_url'=> 'https://ocr-bs.qiniuapi.com',
            '_data'=>[
                'image'=>$imageBase64
            ],
            '_header'=>[
                'Authorization:' . $this->token
            ]
        ])->post();
        print_rr($response, true);die;
        return true;
    }

